    false,nt"url": null,nt"notes": "This data series contains 29 1992-1994
    1-meter panchromatic digital orthoimage tiles. The data cover 29 7.5-minute quadrangles
    scattered around the State of Idaho. The Idaho Geospatial Data Clearinghouse has
    6425 USGS DOQs. There are 29 quarter-quadrangles that have two images (an older
    image and a newer image). The series contains the least recent image for each quarter-quadrangle.
    A USGS digital orthophotoquad (DOQ) is a 1-meter ground resolution, quarter-quadrangle
    (3.75-minutes of latitude by 3.75-minutes of longitude) image cast on the Universal
    Transverse Mercator Projection (UTM) on the North American Datum of 1983 (NAD83).",nt"owner_org":
